import React from 'react';
import BotCard from './BotCard';
import YourBotArmy from './YourBotArmy';

const BotCollection = ({ bots, onAddBot, onReleaseBot, onDischargeBot }) => {
  return (
    <div className="BotCollection">
    <YourBotArmy
        bots={bots.filter((b) => b.army)}
        onRe={removeBot}
        deleteBot={deleteBot}
      />

      <div className="BotsGrid">
        {bots.map((bot) => (
          <BotCard key={bot.id} bot={bot} onAddBot={onAddBot} onRemoveBot={onReleaseBot} onDischargeBot={onDischargeBot} />
        ))}
      </div>
    </div>
  );
};

export default BotCollection;
